import axios from "axios";
import { useState } from "react";
import { Link, useNavigate } from "react-router-dom";

const CreateFavorite = (props) => {
    const [web_name, setWeb_name] = useState("");
    const [url, setUrl] = useState("");
    const [description, setDescription] = useState("");
    const [errors, setErrors] = useState([]);
    const navigate = useNavigate();
    
    const handleSubmit = (e) => {
        e.preventDefault();
        axios
        .post("http://localhost:8000/api/favorites", { 
            web_name,
            url,
            description
        })
        .then((response) => {
        console.log(response);
        console.log(response.data);
        navigate("/display");
        })
        .catch((err) => {
            console.log(err.response.data.err.errors);
            setErrors(err.response.data.err.errors);
        });
    };
    
    return (
        <div class="container">
            <h4>Know a Favorite needing a home?</h4>
            <form id="outline" onSubmit={handleSubmit}>
                <div class="row" id="skill">
                    Skills (optional):
                </div>
                <br></br>
                <div class="row">
                    <div class="col">
                        <div class="form-group">
                            <label htmlFor="name">Favorite Name: </label>
                            <input class="form-control" type="text" id="name" value={name}
                            onChange={(e) => setName(e.target.value)}/>
                            {errors.name ? <p>{errors.name.message}</p> : null}
                        </div>
                    </div>
                    <div class="col">
                        <div class="form-group">
                            <label htmlFor="skill1">Skill 1: </label>
                            <input class="form-control" type="text" id="skill1" value={skill1}
                            onChange={(e) => setSkill1(e.target.value)}/>
                            {errors.skill1 ? <p>{errors.skill1.message}</p> : null}
                        </div>
                    </div>
                </div>
                <br></br>
                <div class="row">
                    <div class="col">
                        <div class="form-group">
                            <label htmlFor="type">Favorite Type: </label>
                            <input class="form-control" type="text" id="type" value={type}
                            onChange={(e) => setType(e.target.value)}/>                 
                            {errors.type ? <p>{errors.type.message}</p> : null}
                        </div>
                    </div>
                    <div class="col">
                        <div class="form-group">
                            <label htmlFor="skill2">Skill 2: </label>
                            <input class="form-control" type="text" id="skill2" value={skill2}
                            onChange={(e) => setSkill2(e.target.value)}/>
                            {errors.skill2 ? <p>{errors.skill2.message}</p> : null}
                        </div>
                    </div>
                </div>
                <br></br>
                <div class="row">
                    <div class="col">
                        <div class="form-group">
                            <label htmlFor="description">Favorite Description: </label>
                            <input class="form-control" type="text" id="description" value={description}
                            onChange={(e) => setDescription(e.target.value)}/>
                            {errors.description ? <p>{errors.description.message}</p> : null}
                        </div>
                    </div>
                    <div class="col">
                        <div class="form-group">
                            <label htmlFor="skill3">Skill 3: </label>
                            <input class="form-control" type="text" id="skill3" value={skill3}
                            onChange={(e) => setSkill3(e.target.value)}/>
                            {errors.skill3 ? <p>{errors.skill3.message}</p> : null}
                        </div>
                    </div>
                </div>
                <br></br>
                <div class="col">
                <button class="btn btn-primary" type="submit" > Add Favorite </button>
                </div>
                <br></br>
            </form>
        </div>
    );
};

export default CreateFavorite;
